import React from 'react';
import { useSelector } from 'react-redux';
import Footer from './FooterWeb.js/Footer';
import Menu from './MenuWeb/Menu';

const GioHang = () => {
    const dulieu = useSelector(state => state.giohang);
    return (
        <div>
            <Menu />
            <div className="container">
                <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>STT</th>
                            <th>Tên cây cảnh</th>
                            <th>Link IMG</th>
                            <th>Gía</th>
                            <th>Thao Tác</th>
                        </tr>
                    </thead>
                    <tbody>
                        {dulieu && dulieu.map((val, index) => {
                            return (
                                <tr key={val.id.toString}>
                                    <td>{index + 1}</td>
                                    <td>{val.name}</td>
                                    <td style={{width: '20%'}}>{val.img}</td>
                                    <td>{val.Gia}</td>
                                    <td><button type="button" class="btn btn-primary btn-lg">Xóa</button></td>
                                </tr>
                            );
                        })}
                    </tbody>
                </table>
            </div>
            <Footer />
        </div>
    );
}
export default GioHang;
